import './App.css';
import Home from './Componnent/Home';
import Test from './Componnent/List_item copy';
import {BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {

  return (
    <Router>

      <Routes>
        <Route path='/' element= {<Home/>}>

        </Route>
        <Route path="/rules" element= {<Test/>}>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
